import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; 

import AdminDashboard from './Components/AdminDashboard/AdminDashboard';
import ProtectedRoute from './Components/Route/ProtectedRoute';
import ProductList from './Components/Product/ViewProducts/ProductList';
import Login from './Components/Login/Login';
import Register from './Components/Register/Register';
import React from 'react';
import { useEffect } from 'react';
import Axios from "axios";


function App() {
  useEffect(  ()=>{
   myfunction()

  },[])

  const myfunction = async () =>{
    let result = await Axios.get('http://localhost:3001/api/get')
    console.log(result)
  }

  return (
    <Router>
      <Switch>
      <React.Fragment>
        <Route exact path="/login">
          <Login/>
        </Route>
        <Route exact path={["/register"]}>
          <Register/>
        </Route>
        <Route exact path={["/", "/baligya"]}>
          <ProductList/>
        </Route>

        <ProtectedRoute path="/dashboard" component={AdminDashboard} isAuth={false}/>
      </React.Fragment>
      </Switch>
    </Router>
  );
}

export default App;
